import {
  createBrowserRouter, 
  createRoutesFromElements,
  Route, 
  RouterProvider,
} from 'react-router-dom'

// pages






const router = createBrowserRouter(
  createRoutesFromElements(
    <Route>

        <Route path="contact" element={<Contact/>} action={contactAction}/>
      </Route>



  )
)

function App() {
  return (
    <RouterProvider router={router} />
  );
}

export default App
